import Card from './Card';

const prodList = ({products, addToCart}) => {

    return (
                <div>
                        {
                            products.map(i => {
                                return (
                                    <Card key={i.id} data={i} addToCart={addToCart} />
                                )
                            })
                        }
                    </div>
    )
}

export default prodList
